import styles from './QueueManager.module.css'
import { useEffect, useState } from 'react';
import { apiBase } from './Api.js'

function QmBare(env) {
  const [jsonData, setJsonData] = useState(null);
  useEffect(() => {
    //fetch('https://course-api.com/react-store-products')
    fetch('http://localhost:9060' + apiBase + 'qmgr')
      .then(response => response.json())
      .then(data => setJsonData(data))
      .catch(error => console.error(error));
  }, []);

  return (
    <div>
      <table>
        <tbody>
          <tr>
            <th>Queue Manager</th>
          </tr>
        </tbody>
      </table>

      {jsonData && (
        <div>
          {jsonData.qmgr.map(obj => (
            <div key={obj.id} className={styles.divContent}>
              <table>
                {obj.name.includes('TU') && obj.name.includes('BARE') && (
                  <tbody>
                    <tr>
                      <th>{obj.name}</th>
                    </tr>
                  </tbody>
                )}
              </table>
            </div>
          ))}
        </div>
      )}
    </div>
  );
};

export default QmBare
